import { Component, Input, OnInit } from '@angular/core';
import { Template, generate } from '@pdfme/generator';
import { TestimonyService } from 'src/app/testimony.service';

export interface Stage {
  name: string;
  status: string;
  user: string;
}

@Component({
  selector: 'app-approval-timeline',
  templateUrl: './approval-timeline.component.html',
  styleUrls: ['./approval-timeline.component.scss'],
})
export class ApprovalTimelineComponent implements OnInit {
  @Input() approvals: any[] = [];
  @Input() date: string;
  @Input() time: string;
  @Input() location: string;
  @Input() committee: string;
  @Input() personTestifying: string;
  @Input() title: string;
  @Input() purpose: string;
  @Input() position: string;
  @Input()
  stages: { [key: string]: Stage } = {
    ready: {
      name: 'Ready',
      status: 'clear',
      user: '-',
    },
    office: {
      name: 'Office approval',
      status: 'clear',
      user: '-',
    },
    pipe: {
      name: 'PIPE approval',
      status: 'clear',
      user: '-',
    },
    final: {
      name: 'Final approval',
      status: 'clear',
      user: '-',
    },
  };

  constructor(private testimonyService: TestimonyService) {
    setTimeout(() => {
      console.log(this.approvals);
      this.approvals.forEach((approval) => {
        this.stages[approval.stage].status = approval.type;
        this.stages[
          approval.stage
        ].user = `${approval.user.first_name} ${approval.user.last_name}`;
      });
    }, 1000);
  }

  generatePDF() {
    (async () => {
      const template: Template = {
        schemas: [
          {
            time: {
              type: 'text',
              position: {
                x: 141.22,
                y: 88.58,
              },
              width: 70.71,
              height: 5.41,
              alignment: 'left',
              fontSize: 13,
              characterSpacing: 0,
              lineHeight: 1,
            },
            date: {
              type: 'text',
              position: {
                x: 141.17,
                y: 83.5,
              },
              width: 70.19,
              height: 5.41,
              alignment: 'left',
              fontSize: 13,
              characterSpacing: 0,
              lineHeight: 1,
            },
            location: {
              type: 'text',
              position: {
                x: 141.12,
                y: 93.76,
              },
              width: 70.72,
              height: 5.41,
              alignment: 'left',
              fontSize: 13,
              characterSpacing: 0,
              lineHeight: 1,
            },
            committee: {
              type: 'text',
              position: {
                x: 141.07,
                y: 98.53,
              },
              width: 70.99,
              height: 5.41,
              alignment: 'left',
              fontSize: 13,
              characterSpacing: 0,
              lineHeight: 1,
            },
            title: {
              type: 'text',
              position: {
                x: 78.72,
                y: 128.48,
              },
              width: 113.84,
              height: 5.41,
              alignment: 'left',
              fontSize: 13,
              characterSpacing: 0,
              lineHeight: 1,
            },
            personTestifying: {
              type: 'text',
              position: {
                x: 78.67,
                y: 118.37,
              },
              width: 113.84,
              height: 5.41,
              alignment: 'left',
              fontSize: 13,
              characterSpacing: 0,
              lineHeight: 1,
            },
            purpose: {
              type: 'text',
              position: {
                x: 78.88,
                y: 137.89,
              },
              width: 113.32,
              height: 5.41,
              alignment: 'left',
              fontSize: 13,
              characterSpacing: 0,
              lineHeight: 1,
            },
            departmentPosition: {
              type: 'text',
              position: {
                x: 26.18,
                y: 156.89,
              },
              width: 165.71,
              height: 86.9,
              alignment: 'left',
              fontSize: 13,
              characterSpacing: 0,
              lineHeight: 1,
            },
          },
        ],
        basePdf:
          'data:application/pdf;base64,',
      };

      const inputs = [
        {
          time: this.time,
          date: this.date,
          location: this.location,
          committee: this.committee,
          title: this.title,
          personTestifying: this.personTestifying,
          purpose: 'Purpose',
          departmentPosition: this.position,
        },
      ];

      const pdf = await generate({ template, inputs });

      // Browser
      const blob = new Blob([pdf.buffer], { type: 'application/pdf' });
      window.open(URL.createObjectURL(blob));
    })();
  }

  ngOnInit(): void {}
}
